function checkEmailValidation(inputValue){
    var str=inputValue;
    var check = /^([\w\.\'\+\-]+)\@([\w\-]{1,63}\.)+[\w\-]{2,63}$/;
    if (check.test(str)) {
        testresults=true;
    } else {
        testresults=false;
    }
    return (testresults);
}
